import React from "react";
import PropTypes from "prop-types";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import Link from "@material-ui/core/Link";

const useStyles = makeStyles((theme) => ({
  mainPost: {
    position: "relative",
    backgroundColor: theme.palette.grey[800],
    color: theme.palette.common.white,
    marginBottom: theme.spacing(4),
    //backgroundImage: 'url(https://source.unsplash.com/random)',
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
  },
  overlay: {
    position: "absolute",
    top: 0,
    bottom: 0,
    right: 0,
    left: 0,
    backgroundColor: "rgba(0,0,0,.3)",
  },
  mainPostContent: {
    position: "relative",
    padding: theme.spacing(3),
    [theme.breakpoints.up("md")]: {
      padding: theme.spacing(6),
      paddingRight: 0,
    },
  },
}));

export default function MainPost(props) {
  const classes = useStyles();
  // const { post } = props;

  return (
    <Paper className={classes.mainPost}>
      {/* Increase the priority of the hero background image */}
      {/* {<img style={{ display: 'none' }} src={post.image} alt={post.imageText} />} */}
      <div className={classes.overlay} />
      <Grid container>
        <Grid item md={6}>
          <div className={classes.mainPostContent}>
            <Typography
              component="h1"
              variant="h4"
              color="inherit"
              gutterBottom
            >
              {/* {post.title} */}
              Simple and fun way to start your cooking experience.
            </Typography>
            <Typography variant="h5" color="inherit" paragraph>
              {/* {post.description} */}
              Love to cook but always struggle to come up with ideas? SmartCook
              is a web app designed for all food lovers who enjoy cooking,
              exploring new recipes, creating recipe journals, and socializing
              about food/cooking.
            </Typography>
            <Link variant="subtitle1" href="#">
              {/* {post.linkText} */}
            </Link>
          </div>
        </Grid>
      </Grid>
    </Paper>
  );
}
